import Footer from '../Components/PageAvantage/Footer/Footer'; 
import Filtre from '../Components/PageAvantage/Filtre-section/Filtre';

function Avantages() {
  return (
    <div>
      <Navbar/> 
      <Title/>
      <Sidebar/><Filtre/>
      
      <Footer/>
    </div>
  )
}

export default Avantages
